import React from 'react';
import "../Styles/Home.css";
function Home() {
  return (
    <div className='home'>
      <p>Welcome to our website, where you can generate letters quickly and easily using our advanced GPT bot. Whether you need to write a cover letter, a recommendation letter, or any other kind of letter, our bot is here to help. Simply enter your information and let the bot do the rest!</p>
      <p>Our website is designed to provide you with a seamless experience from start to finish. We have created a user-friendly form that allows you to input all the necessary information for your letter. Once you submit the form, our bot uses natural language processing to generate a draft of your letter.</p>
    </div>
  );
}

export default Home;
